const moment = require('moment');
const Flight = require('./model/flight.js');
const res = new Array();
const itineranries = json.data.business.SERVICES_POLICY.itinerary;
const listTravellerPrice = json.data.business.Price.listTravellerPrice;
itineranries.forEach((itineranrie) => {
    let flight = new Flight();
    const listSegment = itineranrie.listSegment;
    if (listSegment.length > 2) return;
    listSegment.forEach((segment) => {
        if (segment.endLocation.locationCode != 'SIN') {
            flight.flightCode = segment.airline.code + segment.flightNumber;
            flight.type= 'direct'
            flight.departTerminal =  segment.beginTerminal;
            flight.departDateTime = moment(segment.beginDate, 'MMMM DD, YYYY h:mm:ss A').format('YYYY-MM-DD HH:mm:ss');
            flight.arrivalTerminal = segment.endTerminal;
            flight.arrivalDateTime = moment(segment.endDate, 'MMMM DD, YYYY h:mm:ss A').format('YYYY-MM-DD HH:mm:ss');
            flight.cabinClass = segment.listCabin[0].name;
            flight.bookingClass = segment.listCabin[0].code;
            flight.classType = segment.listCabin[0].code;
            flight.currency = json.data.basefacts.currency;
            listTravellerPrice.forEach((traveller) => {
                const priceBean = traveller.travellerPrice[0].priceBean.recoAmount;
                switch (traveller.traveller.travellerCode) {
                    case 'ADT': 
                        flight.priceAdult = priceBean.amountWithoutTax;
                        flight.taxAdult = priceBean.tax;
                        flight.otherAdult = priceBean.serviceFee + priceBean.oldPrice + priceBean.rebookingFees + priceBean.obFees + priceBean.creditCardFees
                        break;
                    case 'CHD':
                        flight.priceChild = priceBean.amountWithoutTax;
                        flight.taxChild = priceBean.tax;
                        flight.otherChild = priceBean.serviceFee + priceBean.oldPrice + priceBean.rebookingFees + priceBean.obFees + priceBean.creditCardFees
                        break;
                    case 'INF':
                    flight.priceInfant = priceBean.amountWithoutTax;
                    flight.taxInfant = priceBean.tax;
                    flight.otherInfant = priceBean.serviceFee + priceBean.oldPrice + priceBean.rebookingFees + priceBean.obFees + priceBean.creditCardFees
                    break;
                    }
            });
        } else {
            flight.type= '1 stop'
            flight.transitFlightCode = segment.airline.code + segment.flightNumber;
            flight.transitDepartTerminal = segment.beginTerminal;
            flight.transitDepartDateTime = moment(segment.beginDate, 'MMMM DD, YYYY h:mm:ss A').format('YYYY-MM-DD HH:mm:ss');
            flight.transitArrivalTerminal = segment.endTerminal;
            flight.transitArrivalDateTime = moment(segment.endDate, 'MMMM DD, YYYY h:mm:ss A').format('YYYY-MM-DD HH:mm:ss');
            flight.transitAirport = segment.beginLocation.locationCode

        }
    })
    res.push(flight)
});
